        return (
            <html>
                <head>

                </head>

                <body>
                    <div>
                    {followButton}
                    Items:
                        {allItemsHTML}
                        <br/>
                    Sales:
                        {allSalesHTML}
                    </div>
                </body>
            </html>
            )
    }
}

